import styled from "styled-components";

export const CustomInput = styled.div`
display: flex;
width: 100%;
height: 36px;
background-color: white;
flex-wrap: wrap;
border-radius: 10px;
>input{
    font-size: 14px;
    font-family: "Roboto";
    width: 100%;
    height: 100%;
}
`
export const Label = styled.label`
width: 100%;
font-size: 18px;
font-family: "Roboto-Bold";
text-align: start;
`
